def default_nodes(apps, schema_editor):
    Node = apps.get_model('nodes', 'Node')
    reset_nodes(Node)

def reset_nodes(cls):
    for k, v in DATA.items():
        node = cls.nodes.create(parent_id=None, is_deleted=False, value=v['value'], way_to_root='')
        node.save()
        v['pk'] = node.pk
    for k, v in DATA.items():
        if v['parentId']:
            node = cls.nodes.get(pk=int(v['pk']))
            node.parent_id = cls.nodes.get(pk=int(DATA[v['parentId']]['pk']))
            node.save()

